import React from 'react'
import UncontrolledExample from '../components/Carousel'
import Countdown from 'react-countdown'
const HomeScreen = () => {

  return (
    <>

      <UncontrolledExample />

      <Countdown date={Date.now() + 125000000} />
      <CountdownTimer />
    </>
  )
}

export default HomeScreen
